export default class Card{
    constructor(attack, defense, mana, taunt, lifesteal, charge, card_type, img_src){
        this.attack = attack;
        this.defense = defense;
        this.mana = mana;
        this.taunt = taunt;
        this.lifesteal = lifesteal;
        this.charge = charge;
        this.card_type = card_type;
        this.img_src = img_src;

    }

}
